import filmsilver from "../fotos/filmsilver.jpg"
import logoInst from "../fotos/logos/logoinsta.jpg"

const productos = [
    {
        "id":0,
        "img": filmsilver

    },
    {
        "id":1,
        "img": logoInst
    },
    []
]
export default productos
